DROP TABLE IF EXISTS `training_group`;
CREATE TABLE `training_group` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(200) DEFAULT NULL COMMENT '训练组名称',
  `describe` varchar(200) DEFAULT NULL COMMENT '描述',
  `create_user` bigint(20) unsigned DEFAULT NULL COMMENT '创建人',
  `modifi_user` bigint(20) unsigned DEFAULT NULL COMMENT '修改人',
  `gmt_create` datetime DEFAULT NULL COMMENT '创建时间',
  `gmt_modified` datetime DEFAULT NULL COMMENT '修改时间',
  `is_deleted` tinyint(3) unsigned DEFAULT NULL COMMENT '是否删除(1删除 0未删除)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='训练组';

